import React, { Component } from 'react';
import './aboutme.css';
import { Grid, Cell} from 'react-mdl';
import PatrikContact from '../assets/contact-patrik.png'
import Education from './education';
import Experience from './experience';
import Skills from './skills';
import {CollapsibleComponent, CollapsibleHead, CollapsibleContent} from 'react-collapsible-component'


class About extends Component {
    render(){
        return(
            <div className="landingcontainer">
                <Grid>
                <Cell className="left-about" col={6}>
                    <div style={{textAlign: 'center'}}>
                        <img src={PatrikContact} 
                             alt="Patrik Hogler"
                             style={{height: '350px', display: 'block', margin: 'auto', filter:'grayscale(100%', borderRadius:'2%'}}
                             />

                        <h2 className="about-head">Patrik Hogler</h2>
                        <h4 className="about-head2">Front End Developer</h4>
                        <hr className="project-linebreak"></hr>
                        <p className="about-text">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the 
                            industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type 
                            and scrambled it to make a type specimen book.</p>

                        <Skills />
                    </div>
                </Cell>

                <Cell className="right-about" col={6}>
                    <h2 className="about-head">Education</h2>
                    <Education 
                        startYear={2016}
                        endYear={2018}
                        schoolName={'KYH Stockholm'}
                        schoolDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />

                    <Education 
                        startYear={2005}
                        endYear={2008}
                        schoolName={'Huddinge Gymnasium'}
                        schoolDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />



                    <h2 className="about-head">Experience</h2>
                    <CollapsibleComponent>
                    <Experience 
                        startYear={2018}
                        endYear={''}
                        jobName={'Stadium'}
                        jobDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />
                     <Experience 
                        startYear={2017}
                        endYear={2018}
                        jobName={'Studentmedia'}
                        jobDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />


                    <CollapsibleHead className="additionalClassForHead">EXPAND ></CollapsibleHead>
                    <CollapsibleContent className="additionalClassForContent">
                     <Experience 
                        startYear={2015}
                        endYear={2018}
                        jobName={'Svea Ekonomi AB'}
                        jobDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />
                     <Experience 
                        startYear={2013}
                        endYear={2014}
                        jobName={'Samsung Electronic Nordics'}
                        jobDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />
                    <Experience 
                        startYear={2012}
                        endYear={2013}
                        jobName={'Teknikmagasinet'}
                        jobDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />

                    <Experience 
                        startYear={2010}
                        endYear={2012}
                        jobName={'Forex Bank'}
                        jobDescription={'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.'}
                    />
                    </CollapsibleContent>
                 </CollapsibleComponent>

                </Cell>
                </Grid>
                <Footer />
            </div>
        )
    }
}

export default About;
